import { Redirect } from "react-router-dom";
import { useState } from "react";
import { Box, Button, Container, Flex, Heading } from "@chakra-ui/react";
import { useHistory } from "react-router-dom";

export const Dashboard = ({ authenticated }) => {
  const [token] = useState(
    JSON.parse(localStorage.getItem("@Doit:token")) || ""
  );
  const [user] = useState(JSON.parse(localStorage.getItem("@Doit:user")) || "");

  const history = useHistory();

  if (!authenticated) return <Redirect to="/" />;

  return (
    <Container w="100vw" h="100vh" bg="#121214">
      <Flex m="15px 0px 20px 0px " justify="space-around" minWidth="280px">
        <Heading color="#FF577F" fontSize="xl">
          Kenzie Hub
        </Heading>
        <Button
          w="80px"
          bgColor="#212529"
          height="26px"
          color="#FFF"
          fontSize="10px"
          onClick={() => history.push("/")}
        >
          Voltar
        </Button>
      </Flex>

      <Box>
        <Heading></Heading>
      </Box>
    </Container>
  );
};
